import React from "react";
import Tasks from "./Tasks";

export default function TaskList() {
    const taskList = [
        { id: 1, name: 'Dishes', description: "wash the dishes in the kitchen" },
        { id: 2, name: 'Sweep', description: "sweep floor" }
    ]
    return (
        <div className="task-list">
            {taskList.map((task) => (
                <Tasks key={task.id} title = {task.title}/>
            ))}
        </div>
    )
}
